import React from 'react';
import PropTypes from 'prop-types';

const Input = props => {
    const { className, ...inputProps } = props;
    return (
        <input
            className={`px-3 py-1.5 border border-gray-200 focus:outline-none focus:ring focus:ring-indigo-300 rounded ${className}`}
            {...inputProps}
        />
    );
};

Input.propTypes = {
    type: PropTypes.string.isRequired,
    id: PropTypes.string,
    placeholder: PropTypes.string,
};

export default Input;
